dll.append('10');
dll.append('20');
dll.append('30');
console.log(dll.toString()); // 10 20 30
console.log(dll.forwardString()); // 10 20 30
console.log(dll.backwardString()); // 30 20 10
`,paraId:20,tocIndex:12},{value:`// 2.\u5411\u94FE\u8868\u4E2D\u63D2\u5165\u6570\u636E
DoublyLinkedList.prototype.insert = function (position, data) {
  // 1.\u8FB9\u754C\u5224\u65AD
  if (position < 0 || position > this.length) return false;
  var newNode = new Node(data);

  // 2.\u7B2C\u4E00\u6B21\u6DFB\u52A0
  if (this.length === 0) {
    this.head = newNode;
    this.tail = newNode;
  } else {
    if (position === 0) {
      // 3.1 \u5728\u5934\u90E8\u63D2\u5165
      this.head.prev = newNode;
      newNode.next = this.head;
      this.head = newNode;
    } else if (position === this.length) {
      // 3.2 \u5728\u5C3E\u90E8\u63D2\u5165
      newNode.prev = this.tail;
      this.tail.next = newNode;
      this.tail = newNode;
    } else {
      // 3.3 \u5728\u4E2D\u95F4\u63D2\u5165 0 < position < this.length
      var current = this.head;
      var index = 0;
      // \u627E\u5230\u8981\u63D2\u5165\u7684\u4F4D\u7F6E
      while (index++ < position) {
        current = current.next;
      }
      // \u8BA9\u65B0\u8282\u70B9\u7684next \u6307\u5411\u8981\u63D2\u5165\u4F4D\u7F6E\u7684\u8282\u70B9(current)
      newNode.next = current;
      // \u8BA9\u65B0\u8282\u70B9\u7684prev \u6307\u5411 current\u7684prev
      newNode.prev = current.prev;
      // \u5C06\u65B0\u8282\u70B9\u4E0E \u5F53\u524D\u8282\u70B9\u7684 \u524D\u4E00\u4E2A\u8282\u70B9\u7684 next\u5EFA\u7ACB\u5173\u7CFB
      current.prev.next = newNode;
      // \u8BA9newNode\u6210\u4E3Acurrent\u7684\u524D\u4E00\u4E2A\u8282\u70B9
      current.prev = newNode;
    }
  }
  this.length += 1;
  return true;
};
