var printNumbers = function (n) {
  const res = [];
  // \u751F\u6210 n\u4F4D9 \u5982\uFF1An=3 ==> 999
  let end = new Array(n).fill("9").join("");
  for (let i = 1; i <= Number(end); i++) {
    res.push(i);
  }
  return res;
};
