`,paraId:66,tocIndex:17},{value:"\u5251\u6307 Offer 32 - III.\u4ECE\u4E0A\u5230\u4E0B\u6253\u5370\u4E8C\u53C9\u6811III",paraId:0},{value:"medium",paraId:67,tocIndex:17},{value:"\u601D\u8DEF",paraId:68,tocIndex:18},{value:"\u8DDF",paraId:68,tocIndex:18},{value:"\u5251\u6307 Offer 32 - II. \u4ECE\u4E0A\u5230\u4E0B\u6253\u5370\u4E8C\u53C9\u6811 II",paraId:69,tocIndex:18},{value:"\u76F8\u4F3C",paraId:68,tocIndex:18},{value:"\u5728\u5C42\u5E8F\u904D\u5386\u7684\u57FA\u7840\u4E0A\uFF0C\u6539\u53D8\u63A8\u5165level\u7684\u987A\u5E8F\u5373\u53EF",paraId:68,tocIndex:18},{value:"\u4F7F\u7528levelFlag\u53D8\u91CF\uFF0C\u4EA4\u66FFpush\u548Cunshift\u7684\u63A8\u5165\u65B9\u5F0F",paraId:68,tocIndex:18},{value:`/**
 * @param {TreeNode} root
 * @return {number[][]}
 */
var levelOrder = function (root) {
    const q = [];
    if (root !== null) {
        q.push(root);
    }

    const res = [];
    let levelFlag = true;
    while (q.length) {
        const size = q.length;
        const level = [];
        for (let i = 0; i < size; i++) {
            const current = q.shift();
            if (levelFlag) {
                level.push(current.val);
            } else {
                level.unshift(current.val);
            }
            current.left && q.push(current.left);
            current.right && q.push(current.right);
        }
        levelFlag = !levelFlag;
        res.push(level);
    }

    return res;
};
`,paraId:70,tocIndex:18},{value:"\u5251\u6307 Offer 26. \u6811\u7684\u5B50\u7ED3\u6784",paraId:0},{value:"medium",paraId:71,tocIndex:18},{value:"\u540E\u5E8F\u904D\u5386",paraId:72,tocIndex:19},{value:"\u5982\u679CA,B\u7684val\u76F8\u7B49\u4E14 A\uFF0CB\u4E5F\u6709\u76F8\u7B49\u5B50\u7ED3\u6784\uFF0C\u90A3\u4E48\u5C31\u8FD4\u56DEtrue",paraId:72,tocIndex:19},{value:"if (A.val === B.val && compareTree(A, B)) return true",paraId:72,tocIndex:19},{value:"compareTree(rootA,rootB)\u6BD4\u8F83rootA\u4E2D\u662F\u5426\u6709\u5B50\u7ED3\u6784 \u53EF\u4EE5\u5339\u914D\u4E0ArootB",paraId:72,tocIndex:19},{value:"\u91CD\u70B9\u53EF\u4EE5\u653E\u5728compareTree\u51FD\u6570\u662F\u5982\u4F55\u9012\u5F52\u5B9E\u73B0\u6BD4\u8F83\u7684",paraId:72,tocIndex:19},{value:`/**
 * @param {TreeNode} A
 * @param {TreeNode} B
 * @return {boolean}
 */
var isSubStructure = function (A, B) {
  if (A === null || B === null) return false;

  //  \u5BF9\u6BD4rootA\uFF0CrootB\u5B50\u7ED3\u6784\u662F\u5426\u53EF\u4EE5\u5339\u914D\u4E0A
  const compareTree = (rootA, rootB) => {
      // base case
      // \u5F53\u9012\u5F52\u5DE6\u53F3\u5B50\u6811\u76F8\u6BD4\u7684\u65F6\u5019\uFF0C\u53D1\u73B0rootB\u5DF2\u7ECF\u8D70\u5230null\u4E86\uFF0C\u8BF4\u660ErootA,rootB\u5B50\u7ED3\u6784\u76F8\u540C
      if (rootB === null) return true;

      // \u5F53rootB\u4E0D\u4E3Anull\uFF0C\u4F46rootA\u5DF2\u7ECF\u662Fnull\uFF0C\u8BF4\u660E\u4E0D\u662F\u540C\u6837\u7684\u5B50\u7ED3\u6784
      if (rootB !== null && rootA === null) return false;
      if (rootA.val !== rootB.val) return false;

      // \u8D70\u5230\u8FD9\u4E00\u6B65\uFF0C\u8BF4\u660E rootA.val === rootB.val,\u9012\u5F52\u6BD4\u8F83\u5DE6\u5B50\u6811\u548C\u53F3\u5B50\u6811\u662F\u5426\u76F8\u7B49
      return compareTree(rootA.left, rootB.left) && compareTree(rootA.right, rootB.right);
  };

  // \u5982\u679CA,B\u7684val\u76F8\u7B49\u4E14 A\uFF0CB\u4E5F\u6709\u76F8\u7B49\u5B50\u7ED3\u6784\uFF0C\u90A3\u4E48\u5C31\u8FD4\u56DEtrue
  if (A.val === B.val && compareTree(A, B)) return true;

  // \u9012\u5F52\u5224\u65ADA.left || A.right,\u53EA\u8981\u6709\u4E00\u4E2A\u662FB\u7684subTree\uFF0C\u4E5F\u53EF\u4EE5\u8FD4\u56DEtrue
  return isSubStructure(A.left, B) || isSubStructure(A.right, B);
};
