var numWays = function (n) {
    const memo = new Array(n + 1).fill(-1);
    // \u5B9A\u4E49\u5230n\u53F0\u9636\u7684\u65B9\u6CD5
    const dp = (n) => {
        // base case
        if (n === 0) return 1;
        if (n <= 2) return n;

        if (memo[n] !== -1) return memo[n];

        memo[n] = (dp(n - 1) + dp(n - 2)) % 1000000007; // \u9632\u6B62\u6EA2\u51FA
        return memo[n];

        // // n\u53F0\u9636\u7684\u65B9\u6CD5\u7B49\u4E8E \uFF08n-1\uFF09\u7684\u65B9\u6CD5 + \uFF08n-2\uFF09\u7684\u65B9\u6CD5
        // return dp(n - 1) + dp(n - 2);
    }
    return dp(n);
};
