\u8DDF`,paraId:112,tocIndex:26},{value:"64.\u6700\u5C0F\u8DEF\u5F84\u548C",paraId:113,tocIndex:26},{value:"\u76F8\u4F3C",paraId:112,tocIndex:26},{value:`
\u4E0D\u8FC7\u8FD9\u4E2A\u662F\u6C42\u6700\u5927\uFF0C\u4FEE\u6539\u4E00\u4E0B\u8F6C\u79FB\u65B9\u7A0B\u5C31\u884C`,paraId:112,tocIndex:26},{value:`/**
 * @param {number[][]} grid
 * @return {number}
 */
var maxValue = function (grid) {
    const m = grid.length;
    const n = grid[0].length;
    const memo = new Array(m).fill().map(_ => new Array(n).fill(-1));

    // \u8FD4\u56DE[0,0] \u5230[i,j]\u7684\u8DEF\u5F84\u4E0A\u7684\u6700\u5927\u503C
    const dp = (i, j) => {
        // base case
        if (i === 0 && j === 0) return grid[0][0];
        if (i < 0 || j < 0) return -Infinity;

        if (memo[i][j] !== -1) return memo[i][j];

        return memo[i][j] = Math.max(dp(i - 1, j), dp(i, j - 1)) + grid[i][j];
    }
    return dp(m - 1, n - 1);
};
`,paraId:114,tocIndex:26},{value:"\u81EA\u5E95\u5411\u4E0A\uFF08dp\u6570\u7EC4\uFF0C\u52A8\u89C4\uFF09",paraId:115,tocIndex:26},{value:`/**
 * @param {number[][]} grid
 * @return {number}
 */
var maxValue = function (grid) {
    const m = grid.length, n = grid[0].length;
    // dp[i][j]\u8868\u793A\u4ECE[0,0]\u5230[i,j]\u70B9 \u8DEF\u5F84\u4E0A\u7684\u6700\u5927\u503C
    const dp = new Array(m).fill().map(_ => new Array(n).fill(0));

    // base case
    dp[0][0] = grid[0][0];
    for (let i = 1; i < m; i++) {
        dp[i][0] = dp[i - 1][0] + grid[i][0];
    }
    for (let j = 1; j < n; j++) {
        dp[0][j] = dp[0][j - 1] + grid[0][j];
    }

    for (let i = 1; i < m; i++) {
        for (let j = 1; j < n; j++) {
            dp[i][j] = Math.max(dp[i - 1][j], dp[i][j - 1]) + grid[i][j];
        }
    }

    return dp[m - 1][n - 1];
};
