a &
  (b(
    // \u8BA1\u7B97\u51FA2\u4E2A\u52A0\u6570\u4E8C\u8FDB\u5236\u4E0B\u6BCF\u4E00\u4F4D\u7684\u8FDB\u4F4D

    a & b,
  ) <<
    1); // \u8FDB\u4F4D\u505A\u8FDB\u4F4D\u903B\u8F91\uFF0C\u4E5F\u5C31\u662F * 2
`,paraId:254,tocIndex:53},{value:"\u9012\u5F52\u89E3\u6CD5",paraId:255,tocIndex:53},{value:`/**
 * @param {number} a
 * @param {number} b
 * @return {number}
 */
var add = function (a, b) {
  if (b === 0) return a;
  // \u82E5 a = 1001
  // \u82E5 b = 0101
  //        1100 <- \u672C\u4F4D
  //        0001 <- \u8FDB\u4F4D
  //        0010 <- *2 \u540E\u7684\u8FDB\u4F4D
  //        \u7136\u540E\u5C06\uFF08\u672C\u4F4D\u548C\u8FDB\u4F4D*2\u540E\u7684\u503C\u76F8\u52A0\uFF0C\u82E5\u8FD8\u9700\u8981\u8FDB\u4F4D\uFF08\u8FDB\u4F4D\u4E0D\u4E3A0\uFF09\uFF0C\u5219\u7EE7\u7EED\u8FED\u4EE3\u4E0B\u53BB\uFF09

  // \u672C\u4F4D\u6C42\u548C => a^b => 1100
  const sum = a ^ b;
  // \u5148\u8FDB\u4F4D\u6C42\u548C(a&b => 0001)
  // \u7136\u540E (<<1) => \u76F8\u5F53\u4E8E*2 =>\uFF080001 => 0010\uFF09
  const carry = (a & b) << 1;
  // add(1100,0010)
  return add(sum, carry);
};
`,paraId:256,tocIndex:53},{value:"\u8FED\u4EE3\u89E3\u6CD5",paraId:257,tocIndex:53},{value:`/**
 * @param {number} a
 * @param {number} b
 * @return {number}
 */
var add = function (a, b) {
  while (b !== 0) {
    // \u82E5\u8FDB\u4F4D\u8FD8\u6709\uFF0C\u8BF4\u660E\u8FD8\u9700\u8981\u8BA1\u7B97
    const temp = a & b; // \u8BA1\u7B97\u8FDB\u4F4D
    a = a ^ b; // \u672C\u4F4D
    b = temp << 1; // \u300C\u8FDB\u4F4D\u903B\u8F91\u300D*2
  }
  return a;
};
