var postorderTraversal = function (root) {
  let res = [];
  const traversal = (root) => {
    if (root === null) return;
    traversal(root.left);
    traversal(root.right);
    res.push(root.val);
  };
  traversal(root);
  return res;
};
`,paraId:90,tocIndex:24},{value:"173.\u4E8C\u53C9\u641C\u7D22\u6811\u8FED\u4EE3\u5668",paraId:0},{value:"medium",paraId:91,tocIndex:24},{value:"\u4F7F\u7528\u6808\u6A21\u62DF\u4E2D\u5E8F\u904D\u5386\u65F6\uFF0C\u51FD\u6570\u8C03\u7528\u7684\u8FC7\u7A0B",paraId:92,tocIndex:25},{value:"\u4E2D\u5E8F\u904D\u5386\u65F6\uFF0C\u5148\u8BBF\u95EE\u5DE6\u5B50\u6811\uFF0C",paraId:92,tocIndex:25},{value:"\u5F53\u8BBF\u95EE\u5230\u5DE6\u5B50\u6811\u53F6\u5B50\u7ED3\u70B9\uFF0C\u5411\u4E0A\u8BBF\u95EE\u8282\u70B9\uFF0C\u7136\u540E\u8BBF\u95EE\u8BE5\u8282\u70B9\u7684\u53F3\u8282\u70B9\u7684\u5DE6\u5B50\u6811\u53F6\uFF0C",paraId:92,tocIndex:25},{value:"\u7136\u540E\u5FAA\u73AF\u8BE5\u8FC7\u7A0B",paraId:92,tocIndex:25},{value:`// \u601D\u8DEF\uFF1A\u4F7F\u7528\u6808\u6A21\u62DF\u4E2D\u5E8F\u904D\u5386\u7684\u9012\u5F52\u8FC7\u7A0B
/**
 * @param {TreeNode} root
 */
var BSTIterator = function (root) {
  this.traverseLeft(root);
};

BSTIterator.prototype.stack = [];
BSTIterator.prototype.traverseLeft = function (node) {
  while (node !== null) {
    this.stack.push(node);
    node = node.left;
  }
};

/**
 * @return {number}
 */
BSTIterator.prototype.next = function () {
  let curNode = this.stack.pop();
  this.traverseLeft(curNode.right);
  return curNode.val;
};

/**
 * @return {boolean}
 */
BSTIterator.prototype.hasNext = function () {
  return this.stack.length !== 0;
};

/**
 * Your BSTIterator object will be instantiated and called as such:
 * var obj = new BSTIterator(root)
 * var param_1 = obj.next()
 * var param_2 = obj.hasNext()
 */
// @lc code=end
