\u8DDF`,paraId:14,tocIndex:3},{value:"\u5251\u6307 Offer 50. \u7B2C\u4E00\u4E2A\u53EA\u51FA\u73B0\u4E00\u6B21\u7684\u5B57\u7B26",paraId:14,tocIndex:3},{value:"\u76F8\u4F3C",paraId:14,tocIndex:3},{value:`/**
 * @param {string} s
 * @return {number}
 */
var firstUniqChar = function (s) {
    let map = new Map();
    for (const item of s) {
        if (map.has(item)) {
            // \u5DF2\u7ECF\u51FA\u73B0\u8FC7\u5C31\u7D2F\u52A0
            map.set(item, map.get(item) + 1);
        } else {
            map.set(item, 1);
        }
    }

    let res = -1;
    for (let [key, value] of map) {
        if (value === 1) {
            return res = s.indexOf(key);
        }
    }

    return res;
};
