  `,paraId:0},{value:"\u56FE\u89E3",paraId:0},{value:`/**
 * @param {string} s
 * @return {string}
 */
var reverseWords = function (s) {
    let trimStr = [];
    // \u53BB\u9664\u524D\u540E\u7A7A\u683C\u548C \u4E2D\u95F4\u7684\u76F8\u90BB\u7A7A\u683C
    for (const c of s.trim()) {
        if (c !== ' ') {
            trimStr.push(c)
        } else if (trimStr.length !== 0 && trimStr[trimStr.length - 1] !== ' ') {
            trimStr.push(' ')
        }
    }

    // \u7FFB\u8F6Carr [i,j]\u7684\u5185\u5BB9
    const reverse = (arr, i, j) => {
        while (i < j) {
            const temp = arr[i];
            arr[i] = arr[j];
            arr[j] = temp;
            i++;
            j--;
        }
    }
    // \u5148\u53CD\u8F6C\u6574\u4F53
    const n = trimStr.length;
    reverse(trimStr, 0, n - 1);
    // \u518D\u7FFB\u8F6C\u6BCF\u4E2A\u5355\u8BCD

    let start = 0, end = 0;
    while (start < n) {
        while (end < n && trimStr[end] != ' ') {
            end++;
        }
        // while\u7ED3\u675F\uFF0Cend\u6307\u5411\u7A7A\u683C

        // \u7FFB\u8F6C\u5355\u4E2A\u5355\u8BCD
        reverse(trimStr, start, end - 1);
        start = end + 1; // \u5C06start\u5B9A\u4F4D\u5230\u65B0\u7684\u5F00\u5934[end+1]\u7684\u4F4D\u7F6E
        end++; // end\u4E5F\u6307\u5411\u65B0\u7684\u5F00\u5934
    }
    // join
    return trimStr.join('')
};
